pub enum Protocol {

    /// UDP is the traditional DNS port, this is generally the correct choice
    Udp,

    /// TCP can be used for large queries, but not all NameServers support it
    Tcp,
}

pub enum LookupIpStrategy {

    /// Only query for A (Ipv4) records
    Ipv4Only,

    /// Only query for AAAA (Ipv6) records
    Ipv6Only,

    /// Query for A and AAAA in parallel
    Ipv4AndIpv6,

    /// Query for Ipv6 if that fails, query for Ipv4
    Ipv6thenIpv4,

    /// Query for Ipv4 if that fails, query for Ipv6 (default)
    Ipv4thenIpv6,
}

pub enum ResolveErrorKind {

    /// An error with an arbitrary message, referenced as &'static str
    #[fail(display = "{}", _0)]
    Message(&'static str),

    /// An error with an arbitrary message, stored as String
    #[fail(display = "{}", _0)]
    Msg(String),

    /// No records were found for a query
    #[fail(display = "no record found for {}", query)]
    NoRecordsFound {
        /// The query for which no records were found.
        query: Query,
        /// A deadline after which the the `NXDOMAIN` response is no longer
        /// valid, and the nameserver should be queried again.
        valid_until: Option<Instant>,
    },

    /// An error got returned from IO
    #[fail(display = "io error")]
    Io,

    /// An error got returned by the trust-dns-proto crate
    #[fail(display = "proto error")]
    Proto,

    /// A request timed out
    #[fail(display = "request timed out")]
    Timeout,
}

pub enum LookupEither<C: DnsHandle + 'static, P: ConnectionProvider<ConnHandle
                      = C> + 'static> {
    Retry(RetryDnsHandle<NameServerPool<C, P>>),
}
